import React from 'react'
import { ListContainer, ListDescription, ListTitle } from './Styles'


function ItemList({title, description, language, date}) {
  return (
    <ListContainer>
        <>
        <ListTitle>{title}</ListTitle>
        <ListDescription>
          {description}
          <span style={{marginTop:"10px", display: 'flex', justifyContent: 'space-between'}}>
            <strong>Linguagem:</strong> {language}
            <strong>Created_at:</strong> {date}
          </span>

        </ListDescription>
        <hr/>
        </>
    </ListContainer>
  )
}

export default ItemList
